<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8" />
    <title>QUnit JS Tests</title>
    <link rel="stylesheet" href="qunit.css" />
</head>
<body>
    <div id="qunit"></div>
    <div id="qunit-fixture"></div>
    <script src="../lib/requirejs/require.js"></script>
    <script src="util-test.js" data-main="util-test.js"></script>

    <ol id="qunit-tests">
        <li class="pass" id="qunit-test-output0">
            <strong>
                <span class="flatMap array augmentation test"> </span> <b class="counts">(<b class="failed">0</b>, <b class="passed">1</b>, 1)</b>
            </strong>
            <span class="runtime">1 ms</span>
            <ol class="qunit-assert-list">
                <li class="pass">
                    <span class="test-message">Passed!</span>
                </li>
            </ol>
        </li>
    </ol>
</body>
</html>
